import React, { useState } from "react";

export default function Task(props) {
  const [star, setStar] = useState(true ? "Hi" : "No");

  return (
    <li className="task">
      {props.children}
      {props.title}
      {props.important ? setStar(true) : setStar(false)}
      {star}
      <button id={task.id} onClick={() => handleImportance(task.id)}>
        {task.important ? (
          <i className="fa-solid fa-star star"></i>
        ) : !task.important ? (
          <i className="fa-solid fa-star no-star"></i>
        ) : (
          ""
        )}
      </button>
    </li>
  );
}
